val yearfunc = udf((col1 : String) => { 
    if(col1.split("/").length == 3) {
        col1.split("/")(2)
    } else {
        ""
    }
})

val carriers = spark.read.parquet("hdfs://localhost:9000/data/modelled/carriers").withColumnRenamed("pig_output_2", "timestamp")
var airports = spark.read.parquet("hdfs://localhost:9000/data/modelled/airports").withColumnRenamed("pig_output_7", "timestamp")
var planedate = spark.read.parquet("hdfs://localhost:9000/data/modelled/planedate").withColumnRenamed("pig_output_2", "timestamp")

val planedatewithyear = planedate.withColumn("Planeyear", yearfunc(planedate("issue_date")))

airports.createOrReplaceTempView("airports")
planedatewithyear.createOrReplaceTempView("planedate")
carriers.createOrReplaceTempView("carriers")

