val file_2007 = sc.textFile("hdfs://localhost:9000/data/raw/2007.csv").map(_.split(","))


val file_2008 = sc.textFile("hdfs://localhost:9000/data/raw/2008.csv").map(_.split(",")).mapPartitionsWithIndex { (idx, iter) => if (idx == 0) iter.drop(1) else iter }

val header = file_2007.first

val schema2007 = StructType(header.map(field => StructField(field, StringType, true)))

val data_2007 = file_2007.mapPartitionsWithIndex { (idx, iter) => if (idx == 0) iter.drop(1) else iter }.union(file_2008).map { r =>
    val newRow = ArrayBuffer[String]()
    for(i <- 0 until r.length){
        newRow += r(i).toString
    }
    Row.fromSeq(newRow.toSeq)
}

val df2007 = spark.createDataFrame(data_2007, schema2007)

df2007.createOrReplaceTempView("data_2007_2008")
